func noop(...interface{}) {}

func handleEntity(t *testing.T, event v1.PatchEvent, entity Entity) *Feed {
	t.Helper()

	ctx := context.Background()
	n := Node{}
	r := &Runtime{
		entities: map[string]Entity{
			entity.ID(): entity,
		},
		subTree:  path.NewRefTree(),
		evalTree: path.New(),
		entityResourcer: EntityResource{
			PersistentEntity: func(ctx context.Context, en Entity, feed *Feed) error {
				globalData, err := n.makeSearchData(en, feed)
				// t.Log(globalData, err)
				noop(globalData, err)
				flushData, tsCount, err2 := makeTimeSeriesData(ctx, en, feed)
				// t.Log(flushData, tsCount, err2)
				noop(flushData, tsCount, err2)
				return err
			},
			FlushHandler: func(ctx context.Context, en Entity, feed *Feed) error {
				return nil
			},
			RemoveHandler: func(ctx context.Context, en Entity, feed *Feed) error {
				return nil
			},
		},
		entitySubscriptions: map[string]map[string]*repository.Subscription{
			"iotd-e130acba-1fd5-4e4f-8b51-5824d930e19f": {
				"sub-1": {},
			},
		},
	}
	execer := &Execer{
		state: entity,
		preFuncs: []Handler{
			&handlerImpl{fn: r.handleRawData},
		}, //  Patches
		execFunc: entity,
		postFuncs: []Handler{
			&handlerImpl{fn: r.handleTentacle},   // 
			&handlerImpl{fn: r.handleComputed},   // 
			&handlerImpl{fn: r.handlePersistent}, // 
			&handlerImpl{fn: r.handleSubscribe},  //
			//&handlerImpl{fn: r.handleTemplate},
		},
	}
	feed := &Feed{
		Err:      nil,
		Event:    event,
		State:    entity.Raw(),
		EntityID: entity.ID(),
		Patches:  conv(event.Patches()),
	}
	return execer.Exec(ctx, feed)
}

func p(fn func()) time.Duration {
	cup, _ := os.OpenFile(fmt.Sprintf("profile.%d.cpu", time.Now().Unix()), os.O_CREATE|os.O_RDWR, 0o644)
	defer cup.Close()
	pprof.StartCPUProfile(cup)
	defer pprof.StopCPUProfile()

	mem, err := os.Create(fmt.Sprintf("profile.%d.mem", time.Now().Unix()))
	if err != nil {
		log.Fatal("could not create memory profile: ", err)
	}
	defer mem.Close() // error handling omitted for example
	runtime.GC()
	start := time.Now()
	fn() // get up-to-date statistics
	ret := time.Now().Sub(start)
	if err := pprof.WriteHeapProfile(mem); err != nil {
		log.Fatal("could not write memory profile: ", err)
	}
	return ret
}
